"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:150%;\"><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">В пределах котла имеется два потока вторичного перегретого пара с одинаковыми поверхностями нагрева в каждом потоке. Пароперегреватель делится на КПП 1 ст. и КПП 2 ст. (рис. 15). КПП 1 ст. состоит из входного коллектора </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 426</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">20, пакета змеевиков (342 шт. </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 50</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">4) двух выходных коллекторов, из которых по двум паропроводам </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 426</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">20 пар поступает во входной коллектор </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 426</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">20 промперегревателя 2 ст. В каждом паропроводе между 1 и 2 ступенями установлен аварийный впрыскивающий пароохладитель. Пакет промперегревателя 2 ст. выполнен из 300 параллельных комбинированных змеевиков </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 42</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">4 ст. 12Х18Н12Т и 12Х1МФ. Пар после пакета перегревателя поступает в выходной коллектор    </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 630</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">30 ст. 15Х1М1Ф и далее по паропроводу </span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">Æ</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\"> 630</span><span style=\" font-family:\'Symbol\'; font-size:14pt;\">´</span><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">25 15Х1М1Ф к отсечным клапанам ЦСД. На каждом паропроводе за котлом установлен пусковой впрыскивающий двухступенчатый многосопловой пароохладитель, имеющий две группы форсунок разной производительности.</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:150%;\"><span style=\" font-family:\'Times New Roman,serif\'; font-size:14pt;\">Пакеты КПП в/д и КПП 2 ст. вторично перегретого пара крепятся на подвесных трубах. Входной коллектор подвесных труб находится в газоходе, а выходной на потолке поворотной камеры. Входные коллекторы обоих пакетов пароперегревателей располагаются на боковых стенах конвективного газохода.</span><span style=\" font-size:8pt;\"> </span></p>\n"
